// Legend stays top-right overlay.
// Y button = bottom-left BELOW axis (like x-axis title)
// X button = bottom-right BELOW axis
function overlayLegendAndButtons(layout) {
  const l = JSON.parse(JSON.stringify(layout || {}));

  // Legend
  l.legend = Object.assign({}, l.legend, {
    xref: 'paper', yref: 'paper',
    x: 0.985, xanchor: 'right',
    y: 0.985, yanchor: 'top',
    bgcolor: 'rgba(255,255,255,0.35)',
    bordercolor: 'rgba(0,0,0,0.10)', borderwidth: 1
  });

  // Make room below the x-axis for the two buttons
  l.margin = Object.assign({ r: 24, b: 110 }, l.margin, { r: 24, b: Math.max(110, (l.margin?.b || 0)) });

  (l.updatemenus || []).forEach((m) => {
    Object.assign(m, {
      xref: 'paper', yref: 'paper',
      bgcolor: 'rgba(255,255,255,0.35)',
      bordercolor: 'rgba(0,0,0,0.10)', borderwidth: 1,
      pad: { l: 8, r: 8, t: 2, b: 2 },
      showactive: false,
      direction: 'up' // open upward since we're below the axis
    });

    // y ~ -0.18 sits in the same band as a typical x-axis title;
    // tweak to -0.14 … -0.22 depending on your font size.
    const yBelow = -0.18;

    if (m.name === 'yaxis_toggle') {
      m.x = 0.0;   m.xanchor = 'left';
      m.y = yBelow; m.yanchor = 'top';
    } else if (m.name === 'xaxis_toggle') {
      m.x = 1.0;   m.xanchor = 'right';
      m.y = yBelow; m.yanchor = 'top';
    }
  });

  return l;
}


// Hover fade/solid that adapts to however many updatemenus exist
function wireOverlayHover(el) {
  function buildColors(alphaBox, alphaBorder) {
    const obj = {
      'legend.bgcolor': `rgba(255,255,255,${alphaBox})`,
      'legend.bordercolor': `rgba(0,0,0,${alphaBorder})`,
    };
    const menus = (el._fullLayout && el._fullLayout.updatemenus) || [];
    menus.forEach((_, i) => {
      obj[`updatemenus[${i}].bgcolor`] = `rgba(255,255,255,${alphaBox})`;
      obj[`updatemenus[${i}].bordercolor`] = `rgba(0,0,0,${alphaBorder})`;
    });
    return obj;
  }

  const faded = buildColors(0.35, 0.10);
  const solid = buildColors(0.95, 0.25);

  // Apply after the plot is laid out
  el.addEventListener('mouseenter', () => Plotly.relayout(el, solid));
  el.addEventListener('mouseleave', () => Plotly.relayout(el, faded));
  el.addEventListener('plotly_afterplot', () => Plotly.relayout(el, faded));
}

export function renderEqV2Scaling(plot1Id, plot2Id, plot3Id) {
  const el1 = document.getElementById(plot1Id);
  const el2 = document.getElementById(plot2Id);
  const el3 = document.getElementById(plot3Id);

  // Apply overlay treatment to each layout
  const layout1 = overlayLegendAndButtons(Object.assign({autosize: true}, DATA.plot1.layout || {}));
  const layout2 = overlayLegendAndButtons(Object.assign({autosize: true}, DATA.plot2.layout || {}));
  const layout3 = overlayLegendAndButtons(Object.assign({autosize: true}, DATA.plot3.layout || {}));

  Plotly.newPlot(el1, DATA.plot1.data, layout1, {responsive: true});
  Plotly.newPlot(el2, [], layout2, {responsive: true});
  Plotly.newPlot(el3, [], layout3, {responsive: true});

  // Resize handlers
  window.addEventListener('resize', () => {
    Plotly.Plots.resize(el1);
    Plotly.Plots.resize(el2);
    Plotly.Plots.resize(el3);
  });

  // Hover fade/solid for overlays
  wireOverlayHover(el1);
  wireOverlayHover(el2);
  wireOverlayHover(el3);

  // Click handler (unchanged) …
  el1.on('plotly_click', function(eventData) {
    const point = eventData.points[0];
    const { experiment: filename, dataset_size: dsSize } = point.customdata;
    const runs = DATA.experimentData[filename][dsSize.toString()] || [];
    const trainTraces = [], valTraces = [];

    runs.forEach(run => {
      const numParams = run.config.num_params;
      const entries = Object.entries(run.losses).map(([step, vals]) => ({
        step: parseInt(step, 10),
        trainLoss: vals.train_loss ?? null,
        valLoss: vals.val_loss
      })).sort((a, b) => a.step - b.step);

      trainTraces.push({
        x: entries.filter(e => e.trainLoss !== null).map(e => e.step),
        y: entries.filter(e => e.trainLoss !== null).map(e => e.trainLoss),
        mode: 'lines+markers',
        name: `${numParams} params`
      });

      valTraces.push({
        x: entries.map(e => e.step),
        y: entries.map(e => e.valLoss),
        mode: 'lines+markers',
        name: `${numParams} params`
      });
    });

    Plotly.react(el2, trainTraces, Object.assign({}, layout2, {
      title: `Train Loss Curves for Dataset Size = ${Math.round(dsSize)}`
    }));
    Plotly.react(el3, valTraces, Object.assign({}, layout3, {
      title: `Val Loss Curves for Dataset Size = ${Math.round(dsSize)}`
    }));
  });
}
